contract Tokens  {
    using Array for bytes32[];


    mapping(bytes32 => string) private _images;
    string constant _defaultimage =
        "https://github.com/PatrickAlphaC/defi-stake-yield-brownie-freecode/blob/main/front_end/src/dapp.png?raw=true";
    string constant _imageeth =
        "https://raw.githubusercontent.com/PatrickAlphaC/defi-stake-yield-brownie-freecode/main/front_end/src/eth.png?raw=true";

    bytes32[] private _tokens;
    //bytes32[] private _equivtokens;
    //mapping(bytes32 => bytes32[]) private _equivtokenstotokens;
    mapping(bytes32 => Token.Info) private _tokeninfos;

    function token(address token_,uint256 tokenid_) public
    {
        Token.Info storage out_;
        bytes32 tokenhash = BytesAndKeccakLib.pureAddressUInt256(token_, 0);
        out_=_tokeninfos[tokenhash];
        if (out_.features==0)
        {
            _tokeninfos[tokenhash] = Token.tokenInfo(token_,0,true);
            _tokens.insert(tokenhash);
        }
        assert(out_.features!=0);
        if (out_.features& Token.isTokenWithId == 0)
            return;
        Token.Info memory outparent = out_;
        tokenhash = BytesAndKeccakLib.pureAddressUInt256(token_, tokenid_);
        out_=_tokeninfos[tokenhash];
        if (out_.features==0)
        {
            _tokeninfos[tokenhash] = Token.tokenInfoEx(token_,tokenid_,outparent,true);
            _tokens.insert(tokenhash);
        }
        assert(out_.features!=0);
    }


    /*function count() public view returns (uint256) {
        return _tokens.length;
    }

    function equivCount() public view returns (uint256) {
        return _equivtokens.length;
    }

    function get(uint256 _index) public view returns (bytes32) {
        assert(_index < _tokens.length);
        return _tokens[_index];
    }

    function equivGet(uint256 _index) public view returns (bytes32) {
        assert(_index < _equivtokens.length);
        return _equivtokens[_index];
    }

    function get() public view returns (bytes32[] memory) {
        return _tokens;
    }

    function equivGet() public view returns (bytes32[] memory) {
        return _equivtokens;
    }*/

    /*function tokenType(bytes32 token_) public view virtual returns (Token.Type) {
        return _tokeninfos[token_].tokentype;
    }*/
    function tokenInfo(address token_) public view virtual returns (Token.Info memory out_) {
        return tokenInfo(token_,0);
    }
    function tokenInfo(address token_,uint256 tokenId_) public view virtual returns (Token.Info memory out_) {
        if (token_==address(0))
            return Token.Info(-18,false,Token.TypeCurrency);
        out_= _tokeninfos[BytesAndKeccakLib.pureAddressUInt256(token_, 0)];
        if (out_.features& Token.isTokenWithId == 0)
            return out_;
        out_= _tokeninfos[BytesAndKeccakLib.pureAddressUInt256(token_, tokenId_)];
    }
    function features(address token_) public view virtual returns (uint64) {
        return features(token_,0);
    }
    function features(address token_,uint256 tokenId_) public view virtual returns (uint64) {
        if (token_==address(0))
            return Token.TypeCurrency;
        return tokenInfo(token_,tokenId_).features;
    }
    function nft(address token_) public view virtual returns (bool) {
        return nft(token_,0);
    }
    function nft(address token_,uint256 tokenId_) public view virtual returns (bool) {
        if (token_==address(0))
            return false;
        return tokenInfo(token_,tokenId_).nft;
    }
    function granularity(address token_) public view virtual returns (uint256) {
        return granularity(token_,0);
    }
    function granularity(address token_,uint256 tokenId_) public view virtual returns (uint256) {
        if (token_==address(0))
            return 1;
        return Token.granularity(tokenInfo(token_,tokenId_));
    }
    function image(address token_) public view virtual returns (string memory) {
        return image(token_,0);
    }
    function image(address token_,uint256 tokenId_) public view virtual returns (string memory) {
        if (token_==address(0)) return _imageeth;
        string memory _image = _images[BytesAndKeccakLib.pureAddressUInt256(token_, tokenId_)];
        if (
            keccak256(abi.encodePacked((_image))) !=
            keccak256(abi.encodePacked(("")))
        ) return _image;
        if (tokenId_!=0)
        {
            _image = _images[BytesAndKeccakLib.pureAddressUInt256(token_, 0)];
            if (
                keccak256(abi.encodePacked((_image))) !=
                keccak256(abi.encodePacked(("")))
            ) return _image;        
        }
        return _defaultimage;
    }
}
